import React, { Component } from "react";
import { Link, Redirect } from "react-router-dom";
import Swal from "sweetalert2";

export default class AddMovieOption extends Component {
  render() {
    return Swal.fire({
      title: "Add Movies Option",
      showDenyButton: true,
      showCancelButton: true,
      confirmButtonText: "Add one movie",
      denyButtonText: `Add movie dataset`,
    }).then((result) => {
      if (result.isConfirmed) {
        <Redirect to="/Home" />;
      } else if (result.isDenied) {
        Swal.fire("Changes are not saved", "", "info");
      }
    });
  }
}
